import React from "react";

// Import component
import Card from "./card";



function Forecast({forecasts}){

    return(
        <div className="cards-container">
            {forecasts.map((forecast) => (
                <Card
                    day={forecast.day}
                    temp={forecast.temp}
                    clouds={forecast.clouds}
                    high={forecast.high}
                    low={forecast.low}
                />
            ))
            }
        </div>
    );
};

export default Forecast;
